                <source src='https://www.youtube.com/watch?v=crFoWuf52XY' type={'video/mp4'}/>
            </video>

            <video controls width="250">

                <source src="https://www.youtube.com/watch?v=crFoWuf52XY"
                        type="video/webm"/>

                    <source src="https://www.youtube.com/watch?v=crFoWuf52XY"
                            type={'video/mp4'}/>

                        Sorry, your browser doesn't support embedded videos.
            </video>
            <h1 className={'banner-text'}>
                GETTING OVER YOU IS WHAT INSPIRES US
            </h1>
        </div>
    )
};

export default Banner;
